import React, { useState } from 'react';
import { Modal } from 'react-bootstrap';
import { useDispatch } from 'react-redux';
import { addtocart } from '../actions/CartActions';
import './pizza.css'
export default function Pizza({ pizza }) {
  const [quantity, setQuantity] = useState(1);
  const [varient, setVarient] = useState('small');
  const [show, setShow] = useState(false);
  const dispatch = useDispatch();

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  const handleAddToCart = () => {
    dispatch(addtocart({ pizza, quantity, varient }));
    handleClose();
  };

  return (
    <div className="pizza-container" style={{ margin: "50px" }}>
      <div onClick={handleShow} style={{ cursor: 'pointer' }}>
        <h1>{pizza.name}</h1>
        <div className="image-container">
          <img src={pizza.image} className='img-fluid' alt={pizza.name} style={{ width: "100%", height: "100%" }} />
        </div>
      </div>

      <div className="pizza-details">
        <div className='m-1 w-100'>
          <p>Variants</p>
          <select className='form-control' value={varient} onChange={(e) => { setVarient(e.target.value) }}>
            <option value="small">Small</option>
            <option value="medium">Medium</option>
            <option value="large">Large</option>
          </select>
        </div>
        <div className='m-1 w-100'>
          <p>Quantity</p>
          <select className='form-control' value={quantity} onChange={(e) => { setQuantity(e.target.value) }}>
            {[...Array(10).keys()].map((_, i) => (
              <option key={i} value={i + 1}>{i + 1}</option>
            ))}
          </select>
        </div>
      </div>
      <div className="price-container">
        <div className='m-1 w-100'>
          <h1 className='mt-1'>Price: {pizza.prices[0][varient] * quantity} Rs/-</h1>
        </div>
        <div className='m-1 w-100'>
          <button className='btn' onClick={handleAddToCart}>ADD TO CART</button>
        </div>
      </div>
      <Modal show={show} onHide={handleClose}>
        <Modal.Header closeButton>
          <Modal.Title>{pizza.name}</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <div className="image-container">
            <img src={pizza.image} className='img-fluid' style={{ width: "100%", height: "100%" }} />
          </div>
          <p>{pizza.description}</p>
        </Modal.Body>
        <Modal.Footer>
          <button className='btn' onClick={handleClose}>CLOSE</button>
        </Modal.Footer>
      </Modal>
    </div>
  );
}
